import React, {Component} from 'react';
import  "./settings.css"
import  Menu from "../menu/menu"

class Settings extends Component {
        render() {
            return (
            <div>
                <Menu/>
                <div className ="settings">
                    <img src={require("../../images/settings.png")}/>
                    </div>
            </div>
        );
    }
}

export default Settings;
